import React from 'react'

export default function FinalStep(props) {

    const submit = async () => {
        try {
            const name = props.state.name;
            const college = props.state.college;
            const email = props.state.email;
            const phone = props.state.phone;
            const password = props.state.password;

            const body2 = {name, college, email, phone, password};
            console.log(JSON.stringify(body2))
        } catch (error) {
            console.error(error.message);
        }
    }

    return (
        <div>
            <p>Name: {props.state.name}</p>
            <p>Email: {props.state.email}</p>
            <p>Phone: {props.state.phone}</p>
            <p>College: {props.state.college}</p>
            <p>Password: {props.state.password}</p>
            <p>Title: {props.state.title}</p>
            <p>Course: {props.state.course}</p>
            <p>Description: {props.state.description}</p>
            <p>Price: {props.state.price}</p>
            <button onClick={submit}>Confirm these details!</button>
        </div>
    )
}
